import React from 'react'

export default function Items({items}) {
    return (
        <div className="items border col-10 d-flex flex-wrap justify-content-evenly">
            {console.log('items render')}
            {console.log(items)}
            {items.map((item,i)=>
                <div style={{width:'200px',height:'20vh'}} key={i} className="item col-4 border">
                    <img style={{width:'200px',}} src={item.images[0]} alt="" />
                    <p>{item.title}</p>
                </div>
            )}
        </div>
    )
}
